import React, { useState } from "react";
import { Form, Button, Col, Row } from "react-bootstrap";
import { AccountAPI } from "../../API";

const CreateStaff = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    displayName: "",
    dateOfBirth: null,
    cccd: "",
    gender: "Male",
    phoneNumber: "",
    address: "",
    startDate: new Date(), // Default to current date
});
const [error, setError] = useState("");
const [success, setSuccess] = useState("");

const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
};

const handleDateChange = (field, date) => {
    setFormData({ ...formData, [field]: date });
};

const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setSuccess("");

    try {
        await createStaff({
            ...formData,
            dateOfBirth: formData.dateOfBirth.toISOString(),
            startDate: formData.startDate.toISOString(),
        });
        setSuccess("Staff registered successfully!");
        setFormData({
            email: "",
            password: "",
            displayName: "",
            dateOfBirth: null,
            cccd: "",
            gender: "Male",
            phoneNumber: "",
            address: "",
            startDate: new Date(),
        });
    } catch (err) {
        setError(err.response?.data?.message || "Failed to register staff.");
    }
};

return (
    <Form onSubmit={handleSubmit}>
        {error && <Alert variant="danger">{error}</Alert>}
        {success && <Alert variant="success">{success}</Alert>}

        <Row className="mb-3">
            <Form.Group as={Col} controlId="formEmail">
                <Form.Label>Email</Form.Label>
                <Form.Control
                    type="email"
                    name="email"
                    value={formData.email}
                    onChange={handleInputChange}
                    placeholder="Enter email"
                    required
                />
            </Form.Group>

            <Form.Group as={Col} controlId="formPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control
                    type="password"
                    name="password"
                    value={formData.password}
                    onChange={handleInputChange}
                    placeholder="Enter password"
                    required
                />
            </Form.Group>
        </Row>

        <Row className="mb-3">
            <Form.Group as={Col} controlId="formDisplayName">
                <Form.Label>Display Name</Form.Label>
                <Form.Control
                    type="text"
                    name="displayName"
                    value={formData.displayName}
                    onChange={handleInputChange}
                    placeholder="Enter display name"
                    required
                />
            </Form.Group>

            <Form.Group as={Col} controlId="formDateOfBirth">
                <Form.Label>Date of Birth</Form.Label>
                <DatePicker
                    selected={formData.dateOfBirth}
                    onChange={(date) => handleDateChange("dateOfBirth", date)}
                    dateFormat="dd/MM/yyyy"
                    maxDate={new Date()} // Restrict future dates
                    showYearDropdown
                    scrollableYearDropdown
                    placeholderText="Select date of birth"
                    className="form-control"
                    required
                />
            </Form.Group>
        </Row>

        <Row className="mb-3">
            <Form.Group as={Col} controlId="formCCCD">
                <Form.Label>CCCD</Form.Label>
                <Form.Control
                    type="text"
                    name="cccd"
                    value={formData.cccd}
                    onChange={handleInputChange}
                    placeholder="Enter CCCD"
                    required
                />
            </Form.Group>

            <Form.Group as={Col} controlId="formGender">
                <Form.Label>Gender</Form.Label>
                <Form.Select
                    name="gender"
                    value={formData.gender}
                    onChange={handleInputChange}
                    required
                >
                    <option value="Male">Male</option>
                    <option value="Female">Female</option>
                </Form.Select>
            </Form.Group>
        </Row>

        <Row className="mb-3">
            <Form.Group as={Col} controlId="formPhoneNumber">
                <Form.Label>Phone Number</Form.Label>
                <Form.Control
                    type="tel"
                    name="phoneNumber"
                    value={formData.phoneNumber}
                    onChange={handleInputChange}
                    placeholder="Enter phone number"
                    required
                />
            </Form.Group>

            <Form.Group as={Col} controlId="formAddress">
                <Form.Label>Address</Form.Label>
                <Form.Control
                    type="text"
                    name="address"
                    value={formData.address}
                    onChange={handleInputChange}
                    placeholder="Enter address"
                    required
                />
            </Form.Group>
        </Row>

        <Row className="mb-3">
            <Form.Group as={Col} controlId="formStartDate">
                <Form.Label>Start Date</Form.Label>
                <DatePicker
                    selected={formData.startDate}
                    onChange={(date) => handleDateChange("startDate", date)}
                    dateFormat="dd/MM/yyyy"
                    className="form-control"
                    required
                />
            </Form.Group>
        </Row>

        <Button variant="primary" type="submit">
            Register Staff
        </Button>
    </Form>
);
}

export default CreateStaff;
